import React from "react";
import { Link } from "react-router-dom";

import { Container } from 'react-bootstrap';

const Menu = () => {
    
    return (
        <Container className="mx-auto">
            <h1> Tennis Quiz </h1>
            <ul>
                <li>
                    <Link to="/quiz" className="btn btn-primary"> Start </Link>
                </li>
            </ul>
        </Container>
    );
}

export default Menu;
